import React from 'react';
import axios from 'axios'
import react, { Fragment } from 'react'


function App() {
  return (
    <Fragment>
      <h3>Clima</h3>
      <hr/>

      <ul>
        <li>Temperatura atual: </li>
        <li> Temperatura maxima</li>
        <li> Temperatura minima</li>
        <li>Pressao:</li>
        <li>Umidade</li>
      </ul>
    </Fragment>

  )
}

export default App;
